// Fetch quote through Quotable API

export function getQuote() {
    const api_url = "https://api.quotable.io/random";
    var quoteData;

    async function fetchQuote() {
        try {
            fetch(api_url)
                                    .then(data => data.json())
                                    .then(data => console.log(data));
        } catch (error) {
            console.error('Failed to fetch quote')
        }
    }

    fetchQuote();
}
